import React, {useState} from "react";
import axios from "axios";
import {makeStyles} from "@material-ui/core/styles";
import AUTH_ROUTES , {RenderRoutes,RouteWithSubRoutes} from "../Route/AUTH_ROUTES";
import {BrowserRoute,Switch,Route} from "react-router-dom";
import Home from "./Home/Home";
import Club from "./Club/Club";


const useStyles = makeStyles((theme) => ({
NavBar:{
    backgroundColor: "purple",
    minHeight:"3.4em",
    flexDirection:"row",
    alignItems:"center"
},
ClubBar:{
    position:"fixed",
    height:"100%",
    width:"70px",
    backgroundColor:"orange",
    zIndex:"1",
    top:"3.4em",
    overflowX:"hidden",
    paddingTop:"10px"
},
Page:{
    position:"fixed",
    height:"100%",
    width:"100%",
    zIndex:"1",
    top:"3.6em",
    left:"5em",
    paddingTop:"10px"
}


}));

export default function MainPage(){

    return(

        <div>
            <div className={useStyles().NavBar}>HEY</div>
            <div  className={useStyles().ClubBar}>YO</div>
            <div className={useStyles().Page}>
                {/*<Route*/}
                {/*    path={"/mainPage"}*/}
                {/*    exact={true}*/}
                {/*    component={Home}*/}
                {/*/>*/}
                {/*<Route*/}
                {/*    path={"/mainPage/home"}*/}
                {/*    exact={true}*/}
                {/*    component={Home}*/}
                {/*/>*/}
                {/*<Route*/}
                {/*    path={"/mainPage/club"}*/}
                {/*    exact={true}*/}
                {/*    component={Club}*/}
                {/*/>*/}
                {
                    {
                        'home': <Home />,
                        'club': <Club />
                    }

                }[param]


            </div>

        </div>

    )
}
